import React, { useState } from "react";
import "../css/ViewContact.css";
import { useAppContext } from "../appContext";

const ViewContact = () => {
  const {contacts} = useAppContext();
  return (
    <div >
        <table>
            <tr>
                <th>No.</th>
                <th>Name</th>
                <th>Age</th>
                <th>City</th>
            </tr>
            {
                contacts.map((contact,index)=>(
                    <tr>
                        <td>{index+1}</td>
                        <td>{contact.name}</td>
                        <td>{contact.age}</td>
                        <td>{contact.city}</td>
                    </tr>
                ))
            }
        </table>
    </div>
  )
};

export default ViewContact;
